import React, { useState } from 'react';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './ContentPreview.css';

const ContentPreview = () => {
  const [activeTab, setActiveTab] = useState('content');
  const [activeContentTab, setActiveContentTab] = useState('landing-page');

  // Mock data for preview - in a real app, this would come from the actual content management state
  const previewData = {
    hero: {
      headline: 'Find Your Perfect Commercial Property',
      subheading: 'Discover premium office spaces, retail locations, and industrial facilities. Connect with property owners and find the ideal space for your business growth.',
      backgroundImage: '/hero-background.jpg',
      buttonText: 'Start Your Search',
      buttonUrl: '/properties'
    },
    howItWorks: {
      title: 'How It Works',
      steps: [
        {
          id: 1,
          title: 'Find Your Space',
          description: 'Browse through our extensive collection of commercial properties',
          image: '/step1-image.jpg',
          stepNumber: 1
        },
        {
          id: 2,
          title: 'Connect with Brokers',
          description: 'Get in touch with experienced property brokers',
          image: '/step2-image.jpg',
          stepNumber: 2
        },
        {
          id: 3,
          title: 'Secure Your Lease',
          description: 'Complete the leasing process with our support',
          image: '/step3-image.jpg',
          stepNumber: 3
        }
      ]
    },
    team: {
      title: 'Our Team',
      members: [
        {
          id: 1,
          name: 'Ethan Carter',
          role: 'CEO',
          image: '/ethan-carter.jpg'
        },
        {
          id: 2,
          name: 'Sophia Bennett',
          role: 'Head of Sales',
          image: '/sophia-bennett.jpg'
        },
        {
          id: 3,
          name: 'Liam Harper',
          role: 'Lead Developer',
          image: '/liam-harper.jpg'
        },
        {
          id: 4,
          name: 'Olivia Hayes',
          role: 'Marketing Manager',
          image: '/olivia-hayes.jpg'
        }
      ]
    },
    contact: {
      companyName: 'PropertyConnect Solutions',
      physicalAddress: '123 Business District, Suite 456, Downtown, City Center 12345',
      phoneNumber: '+1 (555) 123-4567',
      emailAddress: 'info@propertyconnectsolutions.com'
    },
    faq: {
      title: 'Frequently Asked Questions',
      entries: [
        {
          id: 1,
          question: 'How do I list my property on the platform?',
          answer: 'What is the process for listing a property?'
        },
        {
          id: 2,
          question: 'What types of properties can I find on this platform?',
          answer: 'Our platform offers a wide range of commercial properties, including office spaces, retail locations, and industrial facilities.'
        }
      ]
    },
    disclaimer: 'This platform is provided "as is" without any warranties, express or implied...',
    legalTerms: 'TERMS AND CONDITIONS OF USE\n\n1. ACCEPTANCE OF TERMS\nBy accessing and using this platform...'
  };

  const handlePublishChanges = () => {
    console.log('Publishing changes to live site');
    alert('Changes have been published successfully!');
    // Navigate back to content management
    window.location.href = '/dashboard/content-management';
  };

  const handleBack = () => {
    // Navigate back to content management
    window.location.href = '/dashboard/content-management';
  };

  const renderLandingPagePreview = () => (
    <div className="sys-preview-content">
      <h2 className="sys-preview-section-title">Landing Page Preview</h2>
      
      {/* Hero Section Preview */}
      <div className="sys-hero-preview">
        <div className="sys-hero-image-container">
          <img
            src={previewData.hero.backgroundImage}
            alt="Hero background"
            className="sys-hero-background"
          />
          <div className="sys-hero-overlay">
            <h1 className="sys-hero-headline">{previewData.hero.headline}</h1>
            <p className="sys-hero-subheading">{previewData.hero.subheading}</p>
            <button className="sys-hero-button">{previewData.hero.buttonText}</button>
          </div>
        </div>
      </div>

      {/* Featured Listings Preview */}
      <div className="sys-featured-listings-preview">
        <h3 className="sys-preview-subtitle">Featured Listings</h3>
        <div className="sys-listings-grid">
          <div className="sys-listing-card">
            <img src="/office-space.jpg" alt="Modern Office Space" className="sys-listing-image" />
            <div className="sys-listing-content">
              <h4>Modern Office Space in Downtown</h4>
              <p>Contemporary office space with flexible layouts and stunning city views.</p>
            </div>
          </div>
          <div className="sys-listing-card">
            <img src="/retail-space.jpg" alt="Prime Retail Location" className="sys-listing-image" />
            <div className="sys-listing-content">
              <h4>Prime Retail Location in City Center</h4>
              <p>High-traffic retail space with excellent visibility and customer access.</p>
            </div>
          </div>
          <div className="sys-listing-card">
            <img src="/warehouse.jpg" alt="Spacious Warehouse" className="sys-listing-image" />
            <div className="sys-listing-content">
              <h4>Spacious Warehouse with Easy Access</h4>
              <p>Large warehouse facility with ample storage and convenient transportation links.</p>
            </div>
          </div>
        </div>
      </div>

      {/* Testimonials Preview */}
      <div className="sys-testimonials-preview">
        <h3 className="sys-preview-subtitle">Testimonials</h3>
        <div className="sys-testimonials-grid">
          <div className="sys-testimonial-card">
            <div className="sys-testimonial-header">
              <img src="/sarah-chen.jpg" alt="Sarah Chen" className="sys-testimonial-avatar" />
              <div className="sys-testimonial-info">
                <h4>Sarah Chen</h4>
                <span>2 months ago</span>
              </div>
            </div>
            <div className="sys-testimonial-rating">★★★★★</div>
            <p className="sys-testimonial-text">"This platform was instrumental in finding the perfect office space for our growing team. The listings were accurate, and the support was exceptional."</p>
          </div>
          <div className="sys-testimonial-card">
            <div className="sys-testimonial-header">
              <img src="/david-lee.jpg" alt="David Lee" className="sys-testimonial-avatar" />
              <div className="sys-testimonial-info">
                <h4>David Lee</h4>
                <span>3 months ago</span>
              </div>
            </div>
            <div className="sys-testimonial-rating">★★★★☆</div>
            <p className="sys-testimonial-text">"The team provided valuable insights and guidance throughout the process. We are very satisfied with our new retail location."</p>
          </div>
        </div>
      </div>
    </div>
  );

  const renderContactPreview = () => (
    <div className="sys-preview-content">
      <h2 className="sys-preview-section-title">Contact Information Preview</h2>
      <div className="sys-contact-preview">
        <div className="sys-contact-info">
          <h3>{previewData.contact.companyName}</h3>
          <p><strong>Address:</strong> {previewData.contact.physicalAddress}</p>
          <p><strong>Phone:</strong> {previewData.contact.phoneNumber}</p>
          <p><strong>Email:</strong> {previewData.contact.emailAddress}</p>
        </div>
      </div>
    </div>
  );

  const renderFAQPreview = () => (
    <div className="sys-preview-content">
      <h2 className="sys-preview-section-title">FAQ Preview</h2>
      <div className="sys-faq-preview">
        <h3>{previewData.faq.title}</h3>
        {previewData.faq.entries.map((faq) => (
          <div key={faq.id} className="sys-faq-item">
            <h4>{faq.question}</h4>
            <p>{faq.answer}</p>
          </div>
        ))}
      </div>
    </div>
  );

  const renderDisclaimerPreview = () => (
    <div className="sys-preview-content">
      <h2 className="sys-preview-section-title">Disclaimer Preview</h2>
      <div className="sys-disclaimer-preview">
        <p>{previewData.disclaimer}</p>
      </div>
    </div>
  );

  const renderLegalTermsPreview = () => (
    <div className="sys-preview-content">
      <h2 className="sys-preview-section-title">Legal Terms Preview</h2>
      <div className="sys-legal-terms-preview">
        <pre>{previewData.legalTerms}</pre>
      </div>
    </div>
  );

  const renderAboutUsPreview = () => (
    <div className="sys-preview-content">
      <h2 className="sys-preview-section-title">About Us Preview</h2>
      <div className="sys-about-us-preview">
        <h3>{previewData.team.title}</h3>
        <div className="sys-team-grid">
          {previewData.team.members.map((member) => (
            <div key={member.id} className="sys-team-member-preview">
              <img src={member.image} alt={member.name} className="sys-member-avatar" />
              <h4>{member.name}</h4>
              <p>{member.role}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );

  const renderContent = () => {
    switch (activeContentTab) {
      case 'landing-page':
        return renderLandingPagePreview();
      case 'contact':
        return renderContactPreview();
      case 'faq':
        return renderFAQPreview();
      case 'disclaimer':
        return renderDisclaimerPreview();
      case 'legal-terms':
        return renderLegalTermsPreview();
      case 'about-us':
        return renderAboutUsPreview();
      default:
        return renderLandingPagePreview();
    }
  };

  return (
    <div className="sys-content-preview-page">
      <Header />
      <div className="sys-dashboard-container">
        <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />
        <main className="sys-main-content">
          {/* Breadcrumb */}
          <div className="sys-breadcrumb">
            Content Management / Content Preview
          </div>

          {/* Page Title and Back Button */}
          <div className="sys-page-header">
            <div className="sys-page-title-section">
              <h1 className="sys-page-title">Content Preview</h1>
              <p className="sys-page-description">Review all changes before publishing to the live site</p>
            </div>
            <button 
              className="sys-back-btn"
              onClick={handleBack}
            >
              Back
            </button>
          </div>

          {/* Content Type Tabs */}
          <div className="sys-content-tabs">
            <button
              className={`sys-content-tab ${activeContentTab === 'landing-page' ? 'active' : ''}`}
              onClick={() => setActiveContentTab('landing-page')}
            >
              Landing Page
            </button>
            <button
              className={`sys-content-tab ${activeContentTab === 'contact' ? 'active' : ''}`}
              onClick={() => setActiveContentTab('contact')}
            >
              Contact
            </button>
            <button
              className={`sys-content-tab ${activeContentTab === 'faq' ? 'active' : ''}`}
              onClick={() => setActiveContentTab('faq')}
            >
              FAQ
            </button>
            <button
              className={`sys-content-tab ${activeContentTab === 'disclaimer' ? 'active' : ''}`}
              onClick={() => setActiveContentTab('disclaimer')}
            >
              Disclaimer
            </button>
            <button
              className={`sys-content-tab ${activeContentTab === 'legal-terms' ? 'active' : ''}`}
              onClick={() => setActiveContentTab('legal-terms')}
            >
              Legal Terms
            </button>
            <button
              className={`sys-content-tab ${activeContentTab === 'about-us' ? 'active' : ''}`}
              onClick={() => setActiveContentTab('about-us')}
            >
              About Us
            </button>
          </div>

          {/* Preview Content */}
          {renderContent()}

          {/* Publish Button */}
          <div className="sys-publish-section">
            <button 
              className="sys-publish-btn"
              onClick={handlePublishChanges}
            >
              Publish Changes
            </button>
          </div>
        </main>
      </div>
      <Footer />
    </div>
  );
};

export default ContentPreview;
